import ExpensesFilter from "./Expense Filter/ExpenseFilter";
import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";
import Card from "./Card";

function Expenses(props) {
  const yearChangeHandler = () => {

  }

  return (
    <Card className="expenses"  >
      <div>
        <ExpensesFilter onYearChange={yearChangeHandler} expensesData={props.expenseData} />
      </div>
      {props.expenseData.map(item => <ExpenseItem expense={item}/>)}
    </Card>
  );
}
export default Expenses;
